import './App.css';
import Data from './data.json';

function App() {
  return (
    <div className="App">
      <div>
        <div className="main">
          { Data.map(post => {
            return(
              <div key={post.header} className="data">
              <h2 className="header">{ post.header }</h2>
              <ol className="options">{ post.options }</ol>
              <p className="text">{ post.text }</p>
              </div>
            )
          })}
        </div>
      </div>
    </div>
  );
}

export default App;
